import './AvailableMeals.module.css';
import MealItem from '../MealItem/MealItem';

const AvailableMeals = (props) => {
  return (
    <ul>
      {props.items.map((meal) => (
        <MealItem
          key={meal.id}
          id={meal.id}
          name={props.name}
          description={props.description}
          price={props.price}
        >
          {meal.text}
          <li></li>
        </MealItem>
      ))}
    </ul>
  );
};

export default AvailableMeals;
